import React from 'react'

export const Navbar = () => {
    return (
        <div className='navbar navbar-dark bg-dark mb-4'>
            <span className='navbar-brand'>
                Branco
            </span>
            <button className='btn btn-outline-danger'>
                <span>Salir</span>
            </button>
        </div>
    )
}
